export default {
  async fetch(request) {
    // Always serve the single-page placeholder.
    const url = new URL(request.url);
    if (request.method != "GET" && request.method != "HEAD") {
      return new Response("Method Not Allowed", { status: 405 });
    }

    // Static assets for icons / OG image.
    if (url.pathname === "/favicon-32.png") {
      return new Response(FAVICON_32_PNG, {
        headers: {
          "content-type": "image/png",
          "cache-control": "public, max-age=86400, immutable",
        },
      });
    }
    if (url.pathname === "/apple-touch-icon.png") {
      return new Response(APPLE_TOUCH_PNG, {
        headers: {
          "content-type": "image/png",
          "cache-control": "public, max-age=86400, immutable",
        },
      });
    }
    if (url.pathname === "/og.png") {
      return new Response(OG_PNG, {
        headers: {
          "content-type": "image/png",
          "cache-control": "public, max-age=86400, immutable",
        },
      });
    }

    const html = renderHtml(url.origin);
    return new Response(html, {
      headers: {
        "content-type": "text/html; charset=utf-8",
        // Conservative caching; tweak later when you add assets.
        "cache-control": "public, max-age=60",
      },
    });
  },
};
